&quot;MXC&quot; (formerly known as &quot;Most Extreme Elimination Challenge&quot;) is the ultimate in reality sports, where two teams of contestants are both physically and mentally challenged and eliminated through crazy and challenging games. To add to the fun, there's the hilarious commentary of Kenny Blankenship and Vic Romano, along with field reporter Guy LeDouche (and his many family members) and field marshall/referee Captain Tenneal. This program originally comes from a Japanese reality series called &quot;Takeshi's Castle&quot;, that has been dubbed into English with comedic results that have nothing to do with the original format of the original program.

// EPISODE PLOT:
Stoners vs. Health Nuts - It's vaporizers and exercisers as celebrated Potheads take on the Fitness Industry. It's the classic battle of degenerate stoners versus strong bone-ers. Guy tells us about his diet, meat creamy yoghurt and avocado, while Vic gets high on mushrooms.

